// GetInTouchContainer.js
import Contact from "./GetInTouch";
import "./GetInTouchContainer.css";

const GetInTouchContainer = () => {
  return (
    <div id="getintouch-section" className="getintouch">
      <div className="getintouch-text">Get in Touch</div>
      <Contact
        email="chayanrot.ja@gmail.com"
        emailHref="mailto:chayanrot.ja@gmail.com"
        width="99.16%"
        height="89.02%"
        position="absolute"
        top="10.98%"
        right="0.84%"
        bottom="0%"
        left="0%"
        emailFontSize="25px"
        emailLineHeight="50px"
        emailFontWeight="500"
        emailColor="#3763ff"
        githubLinkLineHeight="50px"
        githubLinkHref="https://github.com/ChayanrothJ"
      />
      <img className="getintouch-child" alt="" src="/line-51.svg" />
    </div>
  );
};

export default GetInTouchContainer;
